import React, {useState} from 'react';
import Header from '../components/Header';
import Sidebar from '../components/Sidebar';
import Footer from '../components/Footer';
import { useNavigate } from 'react-router-dom';

const EditUserList = ({ userInfo, handleLogout }) => {
    const navigate = useNavigate();

    const backManageDevice = () => {
        navigate('/superadmin/ManageUsers');
    };

     // Edit users
     const [userName, setUserName] = useState('');
     const [phoneNumber, setPhoneNumber] = useState('');
     const [emailID, setEmailID] = useState('');
     const [password, setPassword] = useState('');
     const [status, setStatus] =useState('');
     const [errorMessage, setErrorMessage] = useState('');

     const editManageUser = async (e) => {
         alert(  JSON.stringify({ userName, phoneNumber, emailID, address, status }), 'add charger all data' );
         e.preventDefault();
         try {
             const response = await fetch('http://192.168.1.70:9090/GetAllinputData', {
             method: 'POST',
             headers: {
                 'Content-Type': 'application/json',
             },
             body: JSON.stringify({ userName, phoneNumber, emailID, address, status }),
             });
             alert(  JSON.stringify({ userName, phoneNumber, emailID, address }), 'add charger all data' );
             if (response.ok) {
                 alert('Charger added successfully');
                 // Clear the input after successful submission if needed
                 setUserName(''); 
                 setPhoneNumber(''); 
                 setEmailID(''); 
                 setPassword(''); 
             } else {
                 setErrorMessage('Failed to add charger');
             }
         }catch (error) {
             setErrorMessage('An error occurred while adding the charger');
             console.error('Error:', error);
         }
     };  
    return (
        <div className='container-scroller'>
            {/* Header */}
            {/* <Header/> */}
            <Header userInfo={userInfo} handleLogout={handleLogout}/>
            <div className="container-fluid page-body-wrapper">
                {/* Sidebar */}
                <Sidebar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Edit User List</h3>
                                    </div>
                                    <div className="col-12 col-xl-4">
                                        <div className="justify-content-end d-flex">
                                            <button type="button" className="btn btn-success" onClick={backManageDevice}>Back</button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                        <div class="col-12 grid-margin">
                                            <div class="card">
                                                <div class="card-body">
                                                    <h4 class="card-title">Manage Device</h4>
                                                    <form class="form-sample" onSubmit={editManageUser}>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">User Name</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="User Name" value={userName}  onChange={(e) => setUserName(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Phone Number</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Phone Number" pattern="[0-9]{10}" value={phoneNumber} onChange={(e) => setPhoneNumber(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Email ID</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="email" class="form-control" placeholder="Email ID" value={emailID}  onChange={(e) => setEmailID(e.target.value)} readOnly required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Address</label>
                                                                    <div class="col-sm-9">
                                                                        <textarea type="text" class="form-control" placeholder="Password" value={password} maxLength={150} onChange={(e) => setPassword(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Status</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Status" value={status}  onChange={(e) => setStatus(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        {errorMessage && <div className="text-danger">{errorMessage}</div>}
                                                        <div style={{textAlign:'center'}}>
                                                            <button type="submit" class="btn btn-primary mr-2">Update</button>
                                                        </div>
                                                    </form>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    {/* Footer */}
                    <Footer />
                </div>         
            </div>    
        </div>
    );
};   

export default EditUserList
